            <div class="single-item">
              <owl-carousel-o [options]="owlcarouselOptions">
                <ng-container *ngFor="let data of owlcarousel">
                  <ng-template carouselSlide class="item">
                    <div>
                      <h3>{{ data.title }}</h3>
                      <p>{{ data.desc }}</p>
                    </div>
                  </ng-template>
                </ng-container>
              </owl-carousel-o>
            </div>
          </div>
        </div>
        <div class="col-md-7 p-0 card-right">
          <div class="card tab2-card">
            <div class="card-body">
              <ngb-tabset class="tab-coupon mb-0">
                <ngb-tab>
                  <ng-template ngbTabTitle
                    ><i class="icon-user mr-2"></i>Inicio</ng-template
                  >
                  <ng-template ngbTabContent>
                    <div
                      class="tab-pane fade active show"
                      id="account"
                      role="tabpanel"
                      aria-labelledby="account-tab"
                    >
                      <form
                        (ngSubmit)="login()"
                        class="form-horizontal auth-form"
                        novalidate=""
                      >
                        <div class="form-group">
                          <input
                            required=""
                            name="login[username]"
                            [(ngModel)]="username"
                            type="email"
                            class="form-control"
                            placeholder="Usuario"
                            id="exampleInputEmail1"
                          />
                        </div>
                        <div class="form-group">
                          <input
                            required=""
                            name="login[password]"
                            [(ngModel)]="password"
                            type="password"
                            class="form-control"
                            placeholder="Clave"
                          />
                        </div>
                        <div class="form-terms">
                          <div class="custom-control custom-checkbox mr-sm-2">
                            <input
                              type="checkbox"
                              class="custom-control-input"
                              id="customControlAutosizing"
                            />
                            <label
                              class="custom-control-label"
                              for="customControlAutosizing"
                              >Recordar</label
                            >
                            <a
                              href="javascript:void(0)"
                              class="btn btn-default forgot-pass"
                              >Olvide mi clave</a
                            >
                          </div>
                        </div>
                        <div class="form-button">
                          <button class="btn btn-primary" type="submit">
                            Inicio
                          </button>
                        </div>
                      </form>
                    </div>
                  </ng-template>
                </ngb-tab>
                <ngb-tab>
                  <ng-template ngbTabTitle
                    ><i class="icon-unlock mr-2"></i> Registrar
                    <ng-template ngbTabContent>
                      <form
                        (ngSubmit)="login()"
                        class="form-horizontal auth-form"
                        novalidate
                      >
                        <div class="form-group">
                          <input
                            required=""
                            name="login[username]"
                            type="email"
                            class="form-control"
                            placeholder="Usuario"
                            [(ngModel)]="username"
                            id="exampleInputEmail12"
                          />
                        </div>
                        <div class="form-group">
                          <input
                            required=""
                            name="login[password]"
                            [(ngModel)]="password"
                            type="password"
                            class="form-control"
                            placeholder="Clave"
                          />
                        </div>
                        <div class="form-terms">
                          <div class="custom-control custom-checkbox mr-sm-2">
                            <input
                              type="checkbox"
                              class="custom-control-input"
                              id="customControlAutosizing1"
                            />
                            <label
                              class="custom-control-label"
                              for="customControlAutosizing1"
                              ><span
                                >Estoy de acuerdo con todas las declaraciones en
                                <a href="javascript:void(0)" class="pull-right"
                                  >Terms &amp; Conditions</a
                                ></span
                              ></label
                            >
                          </div>
                        </div>
                        <div class="form-button">
                          <button class="btn btn-primary" type="submit">
                            Registrar
                          </button>
                        </div>
                      </form>
                    </ng-template>
                  </ng-template>
                </ngb-tab>
              </ngb-tabset>
            </div>
          </div>
        </div>
      </div>
      <!-- <a [routerLink]="'/dashboard/default'" class="btn btn-primary back-btn">
                <app-feather-icons [icon]="'arrow-left'"></app-feather-icons>
                back
            </a> -->
    </div>
  </div>
</div>
